import React from 'react';

import styled from 'styled-components';

import { v4 as uuidv4 } from 'uuid';

export default function CreateQuestion() {
  return (
    <Component>
          <div id={ uuidv4() } className="question">
              <div className="q-div">
                  
              </div>
      </div>
    </Component>
  );
}

const Component = styled.div``;
